import {
    getProductDate_DATA,
} from '../action/Product';

const initialState = {
    productDate: [{
        image: 'https://image.obdesign.com.tw/catalog/products/AB12653/AB12653@1_50.jpg',
        name: '率性純色異材質拼接長版上衣',
        price: '349',
        distcount: '329',
      }],
};

export default (state=initialState, action) => {
    switch (action.type) {
        case getProductDate_DATA:
            return productDate(state, action);
        default:
            return state;
    }
};

const productDate = (state, action) => {
    const setData = {
      ...state,
      productDate: action.data,
    };
    return setData;
  };
